const Sidebar = ({titles}) =>{
  const title = ()=>{
    titles.map((t)=>{
      return <li>{t}</li>
    })
  }
  return(
    <aside className="sidebar" id="sidebar">
      <ul className="taskList">
        {title()}
      </ul>
    </aside>
  )
}

export default Sidebar;
